import Stan from '../static/photos_main_page-baw.jpg';
import './Section1.css';

const Section1 = () => {
    return(
        <div id="section1">
            <div class="carre" id="c1"></div>
            <div class="carre" id="c2"></div>
            <div class="carre" id="c3"></div>
            <h1>Hi, I'm Stanislas Pielucha.</h1>
            <h1 className="ombre1">Stanislas</h1>
            <h1 className="ombre2">Pielucha</h1>
            <h2>I'm a french student in Software Development in Paris</h2>
            <img src={Stan} /> 
        </div>
    )
}

export default Section1;
